/*
 * Your Stylesheet
 *
 * This stylesheet is loaded when Atom starts up and is reloaded automatically
 * when it is changed.
 *
 * If you are unfamiliar with LESS, you can read more about it here:
 * http://www.lesscss.org
 */
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels {
  background-color: #e6e6e6;
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .breadcrumb a {
  color: #444;
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .breadcrumb > .active a {
  color: #777;
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels *::after,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .icon::before {
  color: rgba(60, 60, 60, 0.6);
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .btn::before,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .package-card::before,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .btn .icon::before,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .package-card .icon::before {
  color: rgba(167, 168, 169, 0.6);
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .section-heading {
  color: #222;
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels h1,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels h2,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels h3,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels h4,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .setting-title,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .text,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .package-readme,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .setting-description,
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .settings-panel label {
  color: #333;
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .setting-description {
  color: #666;
}
atom-pane-container atom-pane .item-views .pane-item.settings-view > .panels .sub-section.collapsed .package-container {
  display: none;
}
atom-text-editor {
  text-rendering: optimizeLegibility;
  font-family: "Fira Code", Monaco;
}
/*
 * Make sure "Use Shadow DOM" is checked in general settings
 */
atom-text-editor::shadow .selection .region {
  background-color: rgba(255, 255, 120, 0.35);
}
